import "./all.css"
import Instrument from "./instrument";
function Set(){
    return(
        <div className="set">
            <Instrument class={"drum w"} text={"w"} music={"tom-1.mp3"}></Instrument>
            <Instrument class={"drum a"} text={"a"} music={"tom-2.mp3"}></Instrument>
            <Instrument class={"drum s"} text={"s"} music={"tom-3.mp3"}></Instrument>
            <Instrument class={"drum d"} text={"d"} music={"tom-4.mp3"}></Instrument>
            <Instrument class={"drum j"} text={"j"} music={"crash.mp3"}></Instrument>
            <Instrument class={"drum k"} text={"k"} music={"kick-bass.mp3"}></Instrument>
            <Instrument class={"drum l"} text={"l"} music={"snare.mp3"}></Instrument>
         </div>
    )
}
export default Set;
